import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoginPage from './components/LoginPage';
import Dashboard from './components/Dashboard';
import InventoryPage from './pages/InventoryPage';
import RequestPage from './pages/RequestPage';
import ApprovePage from './pages/ApprovePage';
import DashboardInventory from './pages/DashboardInventory';
import InventorySummaryPage from './pages/InventorySummaryPage';
import DirectorDashboard from './pages/director/DirectorDashboard';
import InventoryManagerDashboard from './pages/manager/InventoryManagerDashboard';
import FulfillRequestsPage from './pages/FulfillRequestsPage';
import StembassadorDashboard from './pages/stembassador/StembassadorDashboard'; // ✅ Make sure this path is correct
import RequestItemsPage from './pages/stembassador/RequestItemsPage';
import AddUserPage from './pages/director/AddUserPage';
import SignupPage from './components/SignupPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginPage />} />

        {/* Generic fallback dashboard */}
        <Route path="/dashboard" element={<Dashboard />} />

        {/* Role-based dashboards */}
        <Route path="/dashboard/director" element={<DirectorDashboard />} />
        <Route path="/dashboard/inventory" element={<InventoryManagerDashboard />} />
        <Route path="/dashboard/stembassador" element={<StembassadorDashboard />} /> {/* ✅ Fixed */}

        {/* STEMbassador */}
        <Route path="/stembassador/request" element={<RequestItemsPage />} />

        {/* Other pages */}
        <Route path="/signup" element={<SignupPage />} />
        <Route path="/inventory" element={<InventoryPage />} />
        <Route path="/request" element={<FulfillRequestsPage />} />
        <Route path="/approve" element={<ApprovePage />} />
        <Route path="/request-items" element={<RequestItemsPage />} />

        {/* Director-specific pages */}
        <Route path="/director/inventory" element={<InventorySummaryPage />} />
        <Route path="/dashboard/director/add-user" element={<AddUserPage />} />
      </Routes>
    </Router>
  );
}

export default App;
